import React from 'react';
import Pin from './Pin.js';

const PinList = (props = [{id:"ck39qr1do00003h5u776wl1kx", name:"MACKENZIE MOORE", description:"to learn how to use react", color:"#e9724c"}]) => {
  return (
    <React.Fragment>
      { props.length > 0 ? props.pins.map(x => <Pin id={x.id} info={x} offset={props.offset} />) : null }
    </React.Fragment>
  )
}

export default PinList;
